import React, {Component, Fragment} from "react";

// Version 1 of a simple CLass React component
class Link extends Component {
    render() {
        const date = new Date();
        const time = date.toLocaleTimeString();
        return (
            <p>
                <a href={this.props.href}>{this.props.label}</a>
                <br/>Time now is {time}
            </p>
        )
    }
}

class LinkSpreadOperator extends Component {
    render() {
        const date = new Date();
        const time = date.toLocaleTimeString();
        return (
            <p>
                <a href={this.props.href}>{this.props.label}</a>
                <br/>Time now is {time}
            </p>
        )
    }
}

function App() {
  return (
      <div>
          <Fragment>
              <Link label="Read more about React" href="//reactjs.org"/>
              <LinkSpreadOperator label="Read more about React" href="//reactjs.org"/>
          </Fragment>

      </div>

  );
}

export default App;
